import React, { Component } from 'react';
import CardList from './CardList';
import SearchField from './SearchField'
import { robots } from './robots';


const state = {
  robots: robots,
  search: ''
}

class App extends Component {
  render(){
    return(
      <div className='tc'>
        <h1>Robofriends</h1>
        <SearchField />
        <CardList robots={ robots } />
      </div>
    )
  }
}

export default App
